import React, { Component } from "react";
import img from "../image/building.jpg";
const styles = {
  ima: {
    width: "100%",
    height: "300px"
  }
};
class Home extends Component {
  render() {
    const { classes } = this.props;
    return (
      <div>
        <img className={classes.ima} src={img} alt="img" />
      </div>
    );
  }
}

export default Home;
